import React from "react";
import PropTypes from 'prop-types';

const TaskAddButton = ({title}) => {
  return (
    <button className='btn btn-primary'><i className='glyphicon glyphicon-plus'/> {title}</button>
  );
};

TaskAddButton.defaultProps = {
  title: "Add Task"
};

TaskAddButton.propTypes = {
  title: PropTypes.string.isRequired
}

export default TaskAddButton;
